__NUXT_JSONP__("/drugs/Troxacitabine_Nucleotide_Prodrug_MIV-818", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A liver-targeting nucleotide phosphoramidate prodrug of troxacitabine monophosphate (TRX-MP), a dioxolane derivative and L-configuration deoxycytidine analogue, with potential antineoplastic activity. Upon oral administration, MIV-818 is rapidly and specifically hydrolyzed in hepatocytes by liver carboxylesterase 1 (carboxylesterase 1, CE-1), generating high levels of the chain-terminating nucleotide, troxacitabine triphosphate (TRX-TP) in the liver. TRX-TP is then incorporated into tumor cell DNA, leading to termination of DNA synthesis and inhibition of tumor cell proliferation.",fdaUniiCode:"Q1I6YZ0NGF",identifier:"C157496",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C1557"],synonyms:["MIV 818","MIV-818","MIV818",c,"Troxacitabine Prodrug MIV-818"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FTroxacitabine_Nucleotide_Prodrug_MIV-818",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Troxacitabine_Nucleotide_Prodrug_MIV-818","Troxacitabine Nucleotide Prodrug MIV-818","2021-10-30T13:34:40.403Z")));